str = ""

test = list(str)

strlen = len(test)

print(strlen)

print("Start Check")

c = 0
x = 0
z = 1
n = 13
i = 0
Loop = 0

while c < strlen:

    while  test[x] != test[z]:

        print ("++++++++++++++++++",test[x], test[z],"+++++++++++++++++++")

        i = i+1
        z = z+1

        if i == n:
                x = x+1
                z = x+1
                c = c+1
                n = n-1
                i = 0
                Loop = Loop +1
                print ("Loop Ok *******************Loop Count:", Loop)
                
                if Loop == 13:
                    break

        print ("I:",i)
        print ("X:",x)
        print ("Z:",z)
        print ("N:",n)


    if Loop == 13:
            print ("Break all loops - Sequence found!")
            print (test[z-13],test[z-12],test[z-11],test[z-10],test[z-9],test[z-8],test[z-7],test[z-6],test[z-5],test[z-4],test[z-3],test[z-2],test[z-1],test[z])
            print ("First marker after character:", z)
            break


    print ("++++++BREAK++++",test[x], test[z],"++++++BREAK++++")
    i = 0
    n = 13
    Loop = 0
    c = c+1
    x = x+1
    z = x+1
    print ("C:",c)        
    print ("I:",i)
    print ("X:",x)
    print ("Z:",z)
    print ("Loop:",Loop)
